import './css/NavigationBar.css';

class PrimaryNavigationButton extends React.Component {
    render() {
        return (
            <button 
                className={
                    this.props.isActive ? "primary-navigation-button-active" : "prim-primary-navigation-button"
                }
                // onClick={props.onClick}
            >
                {this.props.value}
            </button>
        )
    }
}

